content:
맥도날드 가수원점만 이래요.. 매번 선데이 아이스크림 시켜먹는데 
담다 말으시나요 항상,,;; 
다른 지점들이랑 너무 비교가 돼요

4월29일 굿즈 판매한다길래~ 문의 전화했다가 황당한 일을 겪었네요;; 스타벅스처럼 순식간에 팔릴까봐 가기전 미리 문의 전화했더니
~ 도대체 몇개를 살껀데 그러냐며 짜증을 내더군요;;  10시33분에 통화한 여자분 앞으로 서비스 정신 개조가 필요할듯합니다. 10시 44
분 드라이브 쓰루에서 계산 담당 여자분도 서비스 교육 요망입니다. 물어보는 말에 대답은 안하고 자기 말만 하더군요;;

연말연시 맞이 행운버거 순삭했네요;;
가격을 못올리니 사이즈가 전체적으로 작아졌어요 ㅎㅎ
대식가는 아니라서 적당하다만 남자분들은 부족하실수도 있겠네요~

아침 8시 알바 너무 불친절해요;
그런식으로 일하실거면 서비스직을 하지마세요
괜히 아침 먹으러갔다가 기분 나빠졌네요

사진과는 많이 다르지만^^;
소세지스낵랩  머스타드 소스가 엄청 많이
가성비는 짱

갈때 마다 느끼지만 매장내부 청결 신경을 안쓰네요;;
손님 적을때 테이블 좀 닦아주세요!
#버거세트 #가정동
